 $.getScript('/feb/wp-content/themes/feb_wp_theme/js/fullcalendar.min.js',function(){
  
  var date = new Date();
  var d = date.getDate();
  var m = date.getMonth();
  var y = date.getFullYear();
  
  $('#calendar').fullCalendar({
    header: {
      left: 'prev',
      center: 'title',
      right: 'next'
    },
    editable: true,
    events: [
      {
        title: 'Event',
        start: new Date(y, m, 1)
      },
      {
        title: 'Event',
        start: new Date(y, m, d-5),
        end: new Date(y, m, d-2)
      },
      
      {
        title: 'Event',
        start: new Date(y, m, 19),
        end: new Date(y, m, 23),
        url: 'http://google.com/'
      },
      {
        title: 'Event',
        start: new Date(y, m, 26),
        end: new Date(y, m, 30),
        url: 'http://google.com/'
      }
    ]
  });
})
